import React from "react"


export const Kampanj = ({ kampanjval, setKampanjval, kampanjoption }) => {
    return (
        <div>
            {kampanjoption.map(val => (
                <label key={val} className="radio-summa">
                    <input required
                        className="radio-input"
                        type="radio"
                        value={val}
                        id={val}
                        onChange={e => setKampanjval(e.target.value)}
                        checked={val === kampanjval} />
                    {val}

                </label>
            ))}
        </div>
    )
}
